  input: TEXT,F3XN,,"IN THE WAKE OF HURRICANE KATRINA THE ANESTHESIA FOUNDATION, ONE
    OF THE COMPANIES THAT WE MANAGE, SET UP A WEBSITE TO ACCEPT AND PROCESS CHARITABLE
    CONTRIBUTIONS FOR THE VICTIMS OF THE HURRICANE. UNKNOWN TO THE ACCOUNTING DEPARTMENT,
    THE FIRST CONTRIBUTIONS, MADE ON SEPTEMBER 14-15, 2005, TOTALING $19,080.00,  WERE
    INADVERTANTLY DEPOSITED INTO THE ASAPAC CHECKING ACCOUNT. WHEN WE FOUND OUT THAT
    THE FUNDS WERE BEING DEPOSITED INTO THE ASAPAC ACCOUNT WE CLOSED THE WEBSITE DOWN
    AND TOOK IMMEDIATE ACTION TO CORRECT THE PROBLEM BY ISSUING REFUNDS TO ALL OF
    THE CONTRIBUTORS ON SEPTEMBER 16, 2005. YOU WILL SEE ON THIS MONTH'S REPORT THAT
    $19,080.00 IS REFLECTED AS BEING RECEIVED ON LINE 11  WITH THE SUBSEQUENT REFUNDS
    REFLECTED ON LINE 28A.  THE ASAPAC SINCERELY APOLOGIZES FOR THIS ERROR AND SHOWS
    ITS GOOD INTENTIONS BY ACCEPTING ONLY FEC APPROVED CONTRIBUTIONS AND CORRECTING
    THE SITUATION AS SOON AS IT BECAME APPARENT."
